  input: TEXT,F3XA,,"The amended report discloses additional disbursements not on
    the original report because of the vast amount of data and input required to report.  There
    were almost 600 GOTV disbursements totalling $65,747 to input.  This data was
    compiled by the committee during and immediately after the election.  The amounts,
    dates, names, social security numbers, addresses, etc. were accounted for on excel
    spreadsheets.  Our committee worked with the fecfile software group to try to
    import the spreadsheets into the fecfile software to no avail.  As a result, all
    entries were input into the computer manually.  This effort took a large amount
    of volunteer time and coordination.  The general FEC help line was contacted  and
    we requested direction as to how to file.  We were told to file what we had already
    input and file an amendment with any additional data.  This is the reporting method
    we undertook and we made every effort to report as accurately and timely as possible.                               -
    We have provided the purpose for each disbursement on schedule B.                     -The
    employees who spent more than 25% of their time on federal election activity have
    been moved to line 30(b) and were all paid with federal funds.                            -
    The description of 'GOTV' on Schedule B refers to canvassing and door-to-door
    activity.  The description of 'Voter ID' refers to voter identification phone
    calls.           "
